INSERT INTO `about_us_translations` VALUES (1,1,'ar','<p>NETS, the application you have been waiting for!</p>\n\n<ul>\n	<li>The most intelligent and intuitive networking app.</li>\n	<li>Seamlessly&nbsp;exchange contact details with one click.</li>\n	<li>Automatically link contacts to calendar events and locations.</li>\n	<li>Keep your contacts updated with the Automatic Contact Update feature.</li>\n	<li>Disable and enable cell number sharing.</li>\n</ul>\n\n<ul>\n	<li>Search for contacts by name, event, date or location.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>NETS, short for networks, is the application we all have been waiting for. &nbsp;It solves many of today&rsquo;s contact exchange issues in one easy to use and intuitive app. &nbsp;Here are some of NETS&rsquo; features and benefits.</p>\n\n<p>With NETS you no longer need to print, carry or embarrassingly run out of business cards; in addition, you don&rsquo;t have to worry about what to do with the many business cards you constantly collect. &nbsp;All your contact information are loaded on our app ready for seamless and easy exchange.</p>\n\n<ul>\n	<li>NETS is intuitive and easy to use; launch the app, select LET&rsquo;S NETS and seamlessly exchange info via the QR code.</li>\n	<li>Tired of remembering where and when you met certain people? &nbsp;Confused who&rsquo;s that name on the cards? &nbsp;With NETS&rsquo; calendar synch feature, new contacts will be linked to calendar events, and even if there are no scheduled events, NETS will geotag the contact exchange allowing you to track where and when you met.</li>\n	<li>Sometimes you are at public events and you don&rsquo;t want to share your cell number with everyone you meet, and to solve this problem, NETS allows you to set the cell number sharing feature on or off based on your preference.</li>\n	<li>Are your phone contacts flooded with people you don&rsquo;t know or have hardly been in touch with? &nbsp;NETS solves this by allowing you to keep those contacts only on the app and adding relevant contacts to your phone.</li>\n	<li>Tired of keeping track of contacts and their constantly changing details? &nbsp;Once an exchange is made, NETS will notify you of any future changes in a given contact&rsquo;s details, keeping your data clean and relevant at all times.</li>\n	<li>Can&rsquo;t remember where or when you met someone? &nbsp;Search for contacts by date, event or a variety of easy to use filters.</li>\n</ul>'),(2,1,'en','<p>NETS, the application you have been waiting for!</p>\r\n\r\n<ul>\r\n	<li>The most intelligent and intuitive networking app.</li>\r\n	<li>Seamlessly&nbsp;exchange contact details with one click.</li>\r\n	<li>Automatically link contacts to calendar events and locations.</li>\r\n	<li>Keep your contacts updated with the Automatic Contact Update feature.</li>\r\n	<li>Disable and enable cell number sharing.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Search for contacts by name, event, date or location.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NETS, short for networks, is the application we all have been waiting for. &nbsp;It solves many of today&rsquo;s contact exchange issues in one easy to use and intuitive app. &nbsp;Here are some of NETS&rsquo; features and benefits.</p>\r\n\r\n<p>With NETS you no longer need to print, carry or embarrassingly run out of business cards; in addition, you don&rsquo;t have to worry about what to do with the many business cards you constantly collect. &nbsp;All your contact information are loaded on our app ready for seamless and easy exchange.</p>\r\n\r\n<ul>\r\n	<li>NETS is intuitive and easy to use; launch the app, select LET&rsquo;S NETS and seamlessly exchange info via the QR code.</li>\r\n	<li>Tired of remembering where and when you met certain people? &nbsp;Confused who&rsquo;s that name on the cards? &nbsp;With NETS&rsquo; calendar synch feature, new contacts will be linked to calendar events, and even if there are no scheduled events, NETS will geotag the contact exchange allowing you to track where and when you met.</li>\r\n	<li>Sometimes you are at public events and you don&rsquo;t want to share your cell number with everyone you meet, and to solve this problem, NETS allows you to set the cell number sharing feature on or off based on your preference.</li>\r\n	<li>Are your phone contacts flooded with people you don&rsquo;t know or have hardly been in touch with? &nbsp;NETS solves this by allowing you to keep those contacts only on the app and adding relevant contacts to your phone.</li>\r\n	<li>Tired of keeping track of contacts and their constantly changing details? &nbsp;Once an exchange is made, NETS will notify you of any future changes in a given contact&rsquo;s details, keeping your data clean and relevant at all times.</li>\r\n	<li>Can&rsquo;t remember where or when you met someone? &nbsp;Search for contacts by date, event or a variety of easy to use filters.</li>\r\n</ul>');
