INSERT INTO `setting_translations` VALUES (1,1,'ar','<p><strong><strong>NETS Terms and Conditions</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>1. Introduction</strong></strong></p>\r\n\r\n<p>This document sets forth the terms and conditions for the use of the Electronic Contact Exchange Application (the &quot;Application&quot;) by users (the &quot;Users&quot;). By using the Application, Users agree to be bound by these terms and conditions.</p>\r\n\r\n<p><strong><strong>2. Definitions</strong></strong></p>\r\n\r\n<ul>\r\n	<li>&quot;Application&quot; means the Electronic Contact Exchange Application, as may be modified from time to time.</li>\r\n	<li>&quot;Business Card&quot; means a physical card that contains contact information for a person or organization.</li>\r\n	<li>&quot;Contact&quot; means a person or organization that is included in the Application&#39;s database.</li>\r\n	<li>&quot;User&quot; means any person or organization that uses the Application.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>3. Eligibility</strong></strong></p>\r\n\r\n<p>To use the Application, Users must be at least 18 years of age and have a valid email address.</p>\r\n\r\n<p><strong><strong>4. Registration</strong></strong></p>\r\n\r\n<p>To use the Application, Users must create an account and provide certain information, such as their name, email address, and password.</p>\r\n\r\n<p><strong><strong>5. Use of the Application</strong></strong></p>\r\n\r\n<p>Users may use the Application to:</p>\r\n\r\n<ul>\r\n	<li>Create and manage their contact information.</li>\r\n	<li>Search for and connect with other Users.</li>\r\n	<li>Share their contact information with other Users.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>6. Restrictions on Use</strong></strong></p>\r\n\r\n<p>Users may not use the Application for any of the following purposes:</p>\r\n\r\n<ul>\r\n	<li>To send spam or unsolicited messages.</li>\r\n	<li>To violate the privacy of other Users.</li>\r\n	<li>To engage in illegal or harmful activities.</li>\r\n</ul>\r\n\r\n<p><strong><strong>7. Ownership</strong></strong></p>\r\n\r\n<p>The Application and all content contained therein, including but not limited to text, graphics, logos, icons, images, audio clips, video clips, and software, are the property of the Application&#39;s owner. &nbsp;Users may not copy, reproduce, distribute, modify, or create derivative works of any content contained in the Application without the express written permission of the Application&#39;s owner.</p>\r\n\r\n<p><strong><strong>8. Disclaimer of Warranties</strong></strong></p>\r\n\r\n<p>The Application is provided on an &quot;as is&quot; and &quot;as available&quot; basis. The Application&#39;s owner makes no representations or warranties of any kind, express or implied, as to the operation of the Application or the information, content, materials, or products included on or accessible through the Application. To the fullest extent permissible by applicable law, the Application&#39;s owner disclaims all warranties, express or implied, including but not limited to implied warranties of merchantability and fitness for a particular purpose. The Application&#39;s owner does not warrant that the Application will be uninterrupted or error-free, that defects will be corrected, or that the Application or the server that makes it available are free of viruses or other harmful components.</p>\r\n\r\n<p><strong><strong>9. Limitation of Liability</strong></strong></p>\r\n\r\n<p>In no event shall the Application&#39;s owner be liable for any damages whatsoever, including but not limited to direct, indirect, incidental, consequential, or punitive damages, arising out of or in any way connected with the Application, whether such damages arise out of the use of the Application, the inability to use the Application, or the use of or reliance on any information, content, materials, or products included on or accessible through the Application.</p>\r\n\r\n<p><strong><strong>10. Indemnity</strong></strong></p>\r\n\r\n<p>Users agree to indemnify and hold harmless the Application&#39;s owner from and against any and all claims, damages, losses, liabilities, and expenses (including reasonable attorneys&#39; fees) arising out of or in any way connected with Users&#39; use of the Application, Users&#39; violation of these terms and conditions, or Users&#39; violation of any rights of any third party.</p>\r\n\r\n<p><strong><strong>11. Governing Law</strong></strong></p>\r\n\r\n<p>These terms and conditions shall be governed by and construed in accordance with the laws of the Hashemite Kingdom of Jordan, without regard to its conflict of law provisions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>12. Entire Agreement</strong></strong></p>\r\n\r\n<p>These terms and conditions constitute the entire agreement between Users and the Application&#39;s owner with respect to the use of the Application, and they supersede all prior or contemporaneous communications and proposals, whether oral or written, between Users and the Application&#39;s owner with respect to the Application.</p>\r\n\r\n<p><strong><strong>13. Severability</strong></strong></p>\r\n\r\n<p>If any provision of these terms and conditions is held to be invalid or unenforceable, such provision shall be struck from these terms and conditions and the remaining provisions shall remain in full force and effect.</p>\r\n\r\n<p><strong><strong>14. Changes to Terms and Conditions</strong></strong></p>\r\n\r\n<p>The Application&#39;s owner reserves the right to change these terms and conditions at any time. Users are responsible for reviewing these terms and conditions periodically for changes. Continued use of the Application after any change to these terms and conditions constitutes acceptance of such change.</p>\r\n\r\n<p><strong><strong>15. Contact Information</strong></strong></p>\r\n\r\n<p>If you have any questions about these terms and conditions, please contact the Application&#39;s owner at <a href=\"mailto:nets@dot.jo\">nets@dot.jo</a>.</p>','<p><strong><strong>NETS Privacy Policy</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Introduction</strong></strong></p>\r\n\r\n<p>At NETS we believe that only those you want to share your information with should receive your details. &nbsp;You are the one in control of your data and no one else, and this is how we built our application.</p>\r\n\r\n<p>The document here below explains how we collect, apply and maintain your data; in addition, it details your choices regarding use, maintenance and access of your personal record.</p>\r\n\r\n<p>NETS is the best way to exchange and keep your contacts updated. &nbsp;Not only is it easy and seamless, it also allows you to link those you meet with your calendar for better tracking and connection.</p>\r\n\r\n<p>We are committed to protecting your privacy and the security of your personal information. This Privacy Policy explains how we collect, use, and share your personal information when you use our electronic contact exchange application (the &quot;Application&quot;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>What Personal Information Do We Collect?</strong></strong></p>\r\n\r\n<p>We collect the following personal information from you when you use the Application:</p>\r\n\r\n<ul>\r\n	<li>Your name</li>\r\n	<li>Your email address</li>\r\n	<li>Your phone number</li>\r\n	<li>Your company name</li>\r\n	<li>Your job title</li>\r\n	<li>Your industry</li>\r\n	<li>Your location</li>\r\n</ul>\r\n\r\n<p>We also collect information about your interactions with the Application, such as the contacts you add, the events you attend, and the places you visit.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>How Do We Use Your Personal Information?</strong></strong></p>\r\n\r\n<p>We use your personal information for the following purposes:</p>\r\n\r\n<p>To provide and improve the Application</p>\r\n\r\n<p>To send you marketing communications, if you have opted in to receive them</p>\r\n\r\n<p>To comply with applicable laws and regulations</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>How Do We Share Your Personal Information?</strong></strong></p>\r\n\r\n<p>We do not share your personal information with third parties for their marketing purposes without your consent. We may share your personal information with third parties to provide and improve the Application, such as our payment processors and customer support providers. We may also share your personal information with law enforcement or other government officials if we are required to do so by law.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>How Do We Protect Your Personal Information?</strong></strong></p>\r\n\r\n<p>We take steps to protect your personal information from unauthorized access, use, disclosure, alteration, or destruction. These steps include:</p>\r\n\r\n<p>Using industry-standard security measures, such as firewalls and encryption</p>\r\n\r\n<p>Limiting access to your personal information to authorized employees and contractors</p>\r\n\r\n<p>Requiring employees and contractors to sign confidentiality agreements</p>\r\n\r\n<p>Conducting regular security audits</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>Your Rights</strong></strong></p>\r\n\r\n<p>You have the following rights with respect to your personal information:</p>\r\n\r\n<p>The right to access your personal information</p>\r\n\r\n<p>The right to correct any inaccurate or incomplete personal information</p>\r\n\r\n<p>The right to have your personal information deleted</p>\r\n\r\n<p>The right to object to the processing of your personal information</p>\r\n\r\n<p>The right to restrict the processing of your personal information</p>\r\n\r\n<p>The right to data portability</p>\r\n\r\n<p>The right to withdraw your consent to the processing of your personal information</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To e